import React from 'react';
import Item from './Item';
import '../stylesheets/App.css';

class App extends React.Component {
  render() {
    return ( <div className="App">
    <Item
      name="Cereales con chocolate"
      description="Cereales rellenos de chocolate"
      quantity={2}
      category="Cereales"
      price={5}
    />
  </div>
    );
  }
}

export default App;
